def has_prime_substring(S: str) -> str:
    """"""
    n = len(S)
    if n == 1:
        return 'No'
    count = 0
    pos = -1
    i = 0
    while i < n:
        if S[i] == '1':
            count += 1
            pos = i + 1
        i += 1
    if count == 0 or (count == 1 and pos == n):
        return 'No'
    else:
        return 'Yes'
